import React, { Component } from 'react';
import logo from './images1/HighRadius...jpg';
class NavbarComp extends Component {
    render() { 
        return(  
            <div>
            <nav className="App" >
               <div className="container">
                    <img src={logo}></img>
               </div>
           </nav>
          </div>
        );
    }
}
 
export default NavbarComp;
